import React from "react";
import '../css/Home.css';
import {
    Button,
    Form,
    FormGroup,
    Input,
    Label
} from 'reactstrap';

class Home extends React.Component {

    constructor() {
        super();
        this.state={
            login:false
        }
    }
    render() {
        return(
            <div className="Home">
                <h2>Sign In</h2>
                <Form className="form">
                    <FormGroup>
                        <Label for="exampleEmail">Username</Label>
                        <Input
                            type="email"
                            name="email"
                            id="exampleEmail"
                            placeholder="example@example.com"
                        />
                    </FormGroup>
                    <FormGroup>
                        <Label for="examplePassword">Password</Label>
                        <Input
                            type="password"
                            name="password"
                            id="examplePassword"
                            placeholder="********"
                        />
                    </FormGroup>
                    <Button>Submit</Button>
                </Form>
            </div>
        );
    }
}
    export default Home
